var AERO = new Object();
AERO.UpdateARPlane = function(vertices, indices, name, position, rotation) {
    var babylonScene= engine.scenes[0];
    var aeroScene= babylonScene.getNodeByName("Ag_Anchor").aeroScene;
    var webXRObject = aeroScene.GetWebXR();
    var environmentObject = webXRObject.GetEnvironment();
    var normals = null;
    environmentObject.UpdatePlane(vertices, indices, normals, name, position, rotation);
}

AERO.UpdateCamera = function(px,py,pz,ox,oy,oz, minZ, maxZ, hFov) {
    var babylonScene= engine.scenes[0];
    var aeroScene= babylonScene.getNodeByName("Ag_Anchor").aeroScene;
    var webXRObject = aeroScene.GetWebXR();
    webXRObject.SetCamera(px,py,pz,ox,oy,oz, minZ, maxZ, hFov);
};

AERO.OnHitTest = function(position, normal, camera) {
    var babylonScene= engine.scenes[0];
    var aeroScene= babylonScene.getNodeByName("Ag_Anchor").aeroScene;
    var webXRObject = aeroScene.GetWebXR();
    webXRObject.OnHitTestResult(position, normal, camera);
}

AERO.RemovePlane = function(name) {
    var babylonScene= engine.scenes[0];
    var aeroScene= babylonScene.getNodeByName("Ag_Anchor").aeroScene;
    var webXRObject = aeroScene.GetWebXR();
    var environmentObject = webXRObject.GetEnvironment();
    environmentObject.RemoveAPlane(name);
}

